	background: #bf0000;
	color:#fff;
	font-weight:bold;
	padding:2px 5px;
}

div#HeaderKeyword a {
	color:#0044CC;
}

-->
</style>
<div id="HeaderKeyword">
<br>
<br>
<span>注目のキーワード</span>

気仙椿ハンドクリーム

